create database full_dataset;
use full_dataset;
-- Table: customer
CREATE TABLE customer (
    customer_id VARCHAR(20) PRIMARY KEY,
    name VARCHAR(100),
    email VARCHAR(100),
    city VARCHAR(50)
);

-- Table: product
CREATE TABLE product (
    product_id VARCHAR(20) PRIMARY KEY,
    product_name VARCHAR(100),
    price DECIMAL(10,2)
);

-- Table: user
CREATE TABLE user (
    user_id VARCHAR(20) PRIMARY KEY,
    username VARCHAR(100)
);

-- Table: full_sales_payment (combined sales + payments)
CREATE TABLE full_sales_payment (
    sale_id VARCHAR(36) PRIMARY KEY,
    sale_date DATE,
    customer_id VARCHAR(20),
    name VARCHAR(100),
    email VARCHAR(100),
    city VARCHAR(50),
    product_id VARCHAR(20),
    product_name VARCHAR(100),
    price DECIMAL(10,2),
    quantity INT,
    total DECIMAL(12,2),
    user_id VARCHAR(20),
    username VARCHAR(100),
    payment_id VARCHAR(36),
    payment_amount DECIMAL(12,2),
    payment_mode ENUM('Cash', 'Card', 'Transfer', 'POS'),
    payment_date DATE
);




